module.exports = /*#__PURE__*/JSON.parse('{"releases":["2022-11-01"],"tags":["API and Integration","AWS","Application Servers","Authentication and Security","Build Tools and Package Management","Cloud and Infrastructure","Databases and Data Management","DevOps & Continuous Integration","Development Practices and Methodologies","Frontend Tools","Languages and Frameworks","Languages and frameworks","Monitoring and Alerts","Testing and Quality Assurance","Version Control and Code Management","hmpp","hmpps"],"items":[{"id":".NET","release":"2022-11-01","title":".NET","ring":"hold","quadrant":"languages-and-frameworks","body":"<p>.NET is a software development framework created by Microsoft that supports the creation of applications across various platforms, such as desktop, web, mobile, and cloud. It provides a runtime environment, libraries, and tools for building and running applications in languages like C#, F#, and VB.NET. .NET is known for its flexibility, cross-platform capabilities, and support for object-oriented programming.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[97,314]},{"id":"ADO","release":"2022-11-01","title":"ADO","ring":"trial","quadrant":"tools","body":"<p>ActiveX Data Objects is a Microsoft technology that enables developers to access and manipulate data from various sources, such as databases and files, in a uniform manner. ADO provides a set of COM (Component Object Model) interfaces for data access, allowing for operations like querying, updating, and managing data connections.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[492,636]},{"id":"ADR","release":"2022-11-01","title":"ADR","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>An Architecture Decision Record (ADR) is a document that captures an important architectural decision made during a project, along with the context, reasoning, and consequences of the decision. It serves as a reference for why a particular decision was made, helping teams understand the thought process behind architectural choices.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Development Practices and Methodologies"],"position":[462,273]},{"id":"Agile","release":"2022-11-01","title":"Agile","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>Agile development is a flexible, iterative approach to software development that emphasizes collaboration, customer feedback, and small, incremental releases. It focuses on adapting to change quickly and delivering functional software in short, manageable cycles called sprints.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Development Practices and Methodologies"],"position":[431,389]},{"id":"S3","release":"2022-11-01","title":"Amazon S3","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>Amazon S3 (Simple Storage Service) is a scalable object storage service provided by Amazon Web Services (AWS) that allows users to store and retrieve any amount of data from anywhere on the web. It is commonly used for backup, data archiving, content distribution, and hosting static websites. S3 offers high durability, availability, and security for data storage.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[363,453]},{"id":"Angular","release":"2022-11-01","title":"Angular","ring":"hold","quadrant":"languages-and-frameworks","body":"<p>Angular is a popular open-source web application framework developed by Google, used for building dynamic, single-page web applications. It uses TypeScript, follows a component-based architecture, and provides tools for handling data binding, routing, and state management, making it easier to develop scalable and maintainable apps.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[156,200]},{"id":"Ansible_(VMs_only)","release":"2022-11-01","title":"Ansible (VMs only)","ring":"reduce","quadrant":"tools","body":"<p>An open-source software provisioning, configuration management, and application-deployment tool. It runs on many Unix-like systems, and can configure both Unix-like systems as well as Microsoft Windows. It includes its own declarative language to describe system configuration.</p>\\n","featured":true,"flag":"default","tags":["hmpps","DevOps & Continuous Integration"],"position":[571,744]},{"id":"App_Insights","release":"2022-11-01","title":"App Insights","ring":"adopt","quadrant":"tools","body":"<p>A feature of Azure Monitor - an extensible Application Performance Management (APM) service for developers and DevOps professionals. Use it to monitor your live applications. It will automatically detect performance anomalies, and includes powerful analytics tools.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Monitoring and Alerts"],"position":[475,513]},{"id":"AWS_Public_Cloud","release":"2022-11-01","title":"AWS Public Cloud","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>AWS Public Cloud refers to Amazon Web Services&#39; suite of cloud computing services that are available to the public over the internet. It provides scalable computing resources, storage, and various services (like machine learning, databases, and analytics) on a pay-as-you-go basis, allowing businesses and individuals to leverage powerful infrastructure without the need for on-premises hardware.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[293,501]},{"id":"Azure_-_AKS","release":"2022-11-01","title":"Azure - AKS","ring":"reduce","quadrant":"platforms-and-operations","body":"<p>Azure AKS (Azure Kubernetes Service) is a managed container orchestration service that simplifies deploying, managing, and scaling containerized applications using Kubernetes on Microsoft Azure. It automates tasks such as provisioning, scaling, and upgrading Kubernetes clusters, allowing developers to focus on building and running applications without the complexity of managing the underlying infrastructure.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure"],"position":[259,754]},{"id":"Azure_Public_Cloud","release":"2022-11-01","title":"Azure Public Cloud","ring":"hold","quadrant":"platforms-and-operations","body":"<p>Azure Public Cloud is a cloud computing platform provided by Microsoft that offers a wide range of services, including computing power, storage, and networking, accessible over the internet. It enables businesses and developers to build, deploy, and manage applications and services through Microsoft&#39;s data centers, providing scalability, flexibility, and cost-effectiveness without the need for on-premises infrastructure.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure"],"position":[97,500]},{"id":"BDD","release":"2022-11-01","title":"BDD","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>Behavior-Driven Development (BDD) is a software development methodology that encourages collaboration among developers, QA testers, and non-technical stakeholders. It emphasizes defining application behavior in plain language using scenarios that describe how the software should work from the user&#39;s perspective. This approach helps ensure that all parties have a shared understanding of the requirements and promotes better communication throughout the development process.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[438,369]},{"id":"Beanstalk","release":"2022-11-01","title":"Beanstalk","ring":"reduce","quadrant":"platforms-and-operations","body":"<p>AWS Elastic Beanstalk is a cloud service for deploying and managing applications. It handles infrastructure tasks like scaling, load balancing, and monitoring, allowing developers to focus on writing code. You simply upload your application, and Beanstalk automatically provisions and configures the necessary resources.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[285,765]},{"id":"Browserify","release":"2022-11-01","title":"Browserify","ring":"hold","quadrant":"tools","body":"<p>Browserify is a tool that enables developers to write Node.js-style modules in their JavaScript code and bundle them for use in the browser. It allows the use of the CommonJS module system, which helps manage dependencies and organize code, ultimately making it easier to create modular web applications.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Frontend Tools"],"position":[491,708]},{"id":"C#","release":"2022-11-01","title":"C#","ring":"reduce","quadrant":"languages-and-frameworks","body":"<p>A general-purpose, multi-paradigm programming language encompassing strong typing, lexically scoped, imperative, declarative, functional, generic, object-oriented, and component-oriented programming disciplines.  Typically used with .NET.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[59,229]},{"id":"Chai_(testing)","release":"2022-11-01","title":"Chai","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Chai is a popular assertion library for JavaScript used in testing applications. It provides a variety of assertion styles (like BDD, TDD, and assert) that allow developers to write clear and expressive tests. Chai can be used with various testing frameworks, such as Mocha, to enhance the testing experience by enabling easy validation of expected outcomes in code.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[335,234]},{"id":"Circle_CI","release":"2022-11-01","title":"Circle CI","ring":"adopt","quadrant":"tools","body":"<p>Cloud hosted CI tool providing a continuous integration and continuous delivery platform to build, test, and deploy software.</p>\\n","featured":true,"flag":"default","tags":["hmpps","DevOps & Continuous Integration"],"position":[485,531]},{"id":"Cloud_Managed_DBs","release":"2022-11-01","title":"Cloud Managed DBs","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>Managed databases are typically provided by the cloud provider as-a-Service and takes over many of the difficult or tedious management tasks of a managing a database.  It is typically scalable, manages backups, software patching, automatic failure detection, and recovery.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[284,457]},{"id":"Consumer_Driven_Contracts","release":"2022-11-01","title":"Consumer Driven Contracts","ring":"trial","quadrant":"methods-and-patterns","body":"<p>Consumer-driven contracts (CDC) in API programming refer to a testing approach where the consumer of an API defines the expectations for how the API should behave. Instead of the API provider dictating the contract, consumers specify their requirements, ensuring that the API meets their needs. This approach promotes better alignment between API consumers and providers, facilitates collaboration, and helps prevent breaking changes during development. It is often used in microservices architectures to enhance the reliability of interactions between services.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[472,158]},{"id":"Container_Scanning","release":"2022-11-01","title":"Container Scanning","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>Container scanning is the process of analyzing container images and their components to identify vulnerabilities, security misconfigurations, and compliance issues. This helps ensure that applications running in containers are secure and adhere to best practices before deployment.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Authentication and Security"],"position":[472,323]},{"id":"Cypress_(testing)","release":"2022-11-01","title":"Cypress","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Cypress is a JavaScript-based end-to-end testing framework designed for web applications. It allows developers to write tests that simulate user interactions in a browser, making it easy to test the functionality, performance, and reliability of web applications in real-time. Cypress provides a rich API and a user-friendly interface for creating, running, and debugging tests.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[357,372]},{"id":"DevOps","release":"2022-11-01","title":"DevOps","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>DevOps is a set of practices that combines software development (Dev) and IT operations (Ops) to enhance collaboration, automate processes, and improve the efficiency of delivering software applications. It emphasizes continuous integration, continuous delivery, and rapid feedback, aiming to shorten development cycles and increase the frequency of deployments while ensuring high quality and reliability.</p>\\n","featured":true,"flag":"default","tags":["hmpps","DevOps & Continuous Integration"],"position":[538,289]},{"id":"Platform_-_Docker","release":"2022-11-01","title":"Docker","ring":"adopt","quadrant":"tools","body":"<p>A lightweight, standalone, executable package of software that includes everything needed to run an application: code, runtime, system tools, system libraries and settings.</p>\\n","featured":true,"flag":"default","tags":["hmpps","DevOps & Continuous Integration"],"position":[478,434]},{"id":"Docker_Hub_(public)","release":"2022-11-01","title":"Docker Hub (public)","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>Docker Hub is a cloud-based repository service that allows developers to store, share, and manage Docker container images. It provides a central place for users to publish their images, access official images from Docker and community contributors, and collaborate on projects. Docker Hub also includes features like version control, automated builds, and integration with various CI/CD tools.</p>\\n","featured":true,"flag":"default","tags":["hmpps","DevOps & Continuous Integration"],"position":[243,462]},{"id":"Docker-compose","release":"2022-11-01","title":"Docker-compose","ring":"adopt","quadrant":"tools","body":"<p>(Dev only - not for Production use).  A tool for defining and running multi-container Docker applications. With Compose, you use a YAML file to configure your application&#39;s services.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[460,545]},{"id":"Domain_Driven_Design","release":"2022-11-01","title":"Domain Driven Design","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>Domain-Driven Design (DDD) is a software development approach that emphasizes collaboration between technical and domain experts to create a shared understanding of the problem domain. It focuses on modeling complex systems based on the core business concepts and processes, using a common language (Ubiquitous Language) to align design and implementation with business needs. DDD promotes creating modular, maintainable systems through the identification of bounded contexts, where specific models apply, facilitating better communication and integration across different parts of the application.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Development Practices and Methodologies"],"position":[474,361]},{"id":"EC2","release":"2022-11-01","title":"EC2","ring":"reduce","quadrant":"platforms-and-operations","body":"<p>AWS EC2 (Amazon Elastic Compute Cloud) is a web service that provides scalable virtual servers, known as instances, in the cloud. It allows users to run applications, manage storage, and configure compute capacity on-demand with flexibility and control over resources.</p>\\n","featured":true,"flag":"default","tags":["hmpp","Cloud and Infrastructure","AWS"],"position":[220,712]},{"id":"ECR_(private_repo)","release":"2022-11-01","title":"ECR (private repo)","ring":"reduce","quadrant":"platforms-and-operations","body":"<p>AWS ECR (Elastic Container Registry) is a fully managed container registry service that allows developers to store, manage, and deploy Docker container images. It integrates with Amazon ECS, EKS, and other services, enabling seamless workflows for deploying containerized applications.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[37,528]},{"id":"ECS","release":"2022-11-01","title":"ECS","ring":"reduce","quadrant":"platforms-and-operations","body":"<p>Amazon Elastic Container Service (ECS) is a fully managed container orchestration service that enables users to run, manage, and scale Docker containers on AWS. It simplifies the deployment of applications by handling the underlying infrastructure, allowing developers to focus on building and running their applications without worrying about the complexities of managing servers.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[50,547]},{"id":"ElastiCache_Redis","release":"2022-11-01","title":"ElastiCache Redis","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>Amazon ElastiCache for Redis is a fully managed, in-memory caching service provided by AWS that allows users to deploy, operate, and scale Redis, an open-source, in-memory data structure store. ElastiCache for Redis is designed to improve the performance of applications by providing quick data retrieval and caching capabilities, enabling faster response times and reduced latency for frequently accessed data.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[304,472]},{"id":"ES_Lint","release":"2022-11-01","title":"ES Lint","ring":"adopt","quadrant":"tools","body":"<p>A pluggable and configurable linter tool for identifying and reporting on patterns in JavaScript.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Frontend Tools","Testing and Quality Assurance"],"position":[454,432]},{"id":"Node.js_-_Express","release":"2022-11-01","title":"Express","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>A minimal and flexible Node.js web application framework that provides a robust set of features for web and mobile applications and APIs.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[234,319]},{"id":"Feature_switching","release":"2022-11-01","title":"Feature switching","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>Feature switching, also known as feature toggling or feature flags, is a software development practice that allows developers to enable or disable specific functionalities in an application without deploying new code. This technique is often used for testing, gradual rollouts, and managing features in production environments, enabling teams to control the user experience and minimize risk.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[489,239]},{"id":"Flyway","release":"2022-11-01","title":"Flyway","ring":"adopt","quadrant":"tools","body":"<p>Flyway is an open-source database migration tool that helps manage version control for databases. It enables developers to apply, track, and version database schema changes through a series of migration scripts, ensuring that the database is consistently updated across different environments.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[526,525]},{"id":"GDS_Service","release":"2022-11-01","title":"GDS Service Standard","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>The GDS (Government Digital Service) Service Standard is a set of criteria established by the UK Government Digital Service to ensure that government services are designed and delivered effectively and efficiently. It provides guidelines for service teams to follow, emphasizing user needs, accessibility, usability, and continuous improvement, aiming to enhance the overall user experience in digital government services.</p>\\n<p><a target=\\"_blank\\" rel=\\"noopener noreferrer\\" href=\\"https://www.gov.uk/service-manual/service-standard\\">https://www.gov.uk/service-manual/service-standard</a></p>\\n","featured":true,"flag":"default","tags":["hmpps","Development Practices and Methodologies"],"position":[419,345]},{"id":"Geb","release":"2022-11-01","title":"Geb","ring":"hold","quadrant":"languages-and-frameworks","body":"<p>GEB (Groovy Enterprise Browser) is an automation tool that allows users to control web browsers programmatically using the Groovy programming language. It provides a simple and expressive API for testing web applications by interacting with web elements, simulating user actions, and verifying application behavior, making it a popular choice for functional testing. GEB integrates with testing frameworks like Spock and JUnit, enhancing the test automation experience.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[170,173]},{"id":"Github","release":"2022-11-01","title":"Github","ring":"adopt","quadrant":"tools","body":"<p>GitHub is a web-based platform that uses Git for version control and collaboration, allowing developers to store, manage, and share code repositories. It provides tools for issue tracking, project management, and team collaboration, making it easier for individuals and teams to work on software projects together.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Version Control and Code Management"],"position":[462,467]},{"id":"GoLang","release":"2022-11-01","title":"GoLang","ring":"reduce","quadrant":"languages-and-frameworks","body":"<p>Go, often referred to as Golang, is an open-source programming language developed by Google. It is designed for simplicity, efficiency, and strong support for concurrent programming, making it well-suited for building scalable and high-performance applications, particularly in cloud computing and web services.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[111,150]},{"id":"Gradle_(Groovy-based)","release":"2022-11-01","title":"Gradle (Groovy-based)","ring":"reduce","quadrant":"tools","body":"<p>An open-source build automation system that builds upon the concepts of Apache Ant and Apache Maven and introduces a Groovy or Kotlin-based domain-specific language instead of the XML form used by Apache Maven for declaring the project configuration.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[627,692]},{"id":"Gradle_(Kotlin-based)","release":"2022-11-01","title":"Gradle (Kotlin-based)","ring":"adopt","quadrant":"tools","body":"<p>An open-source build automation system that builds upon the concepts of Apache Ant and Apache Maven and introduces a Groovy or Kotlin-based domain-specific language instead of the XML form used by Apache Maven for declaring the project configuration.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[542,480]},{"id":"Grafana","release":"2022-11-01","title":"Grafana","ring":"adopt","quadrant":"tools","body":"<p>An open source analytics &amp; monitoring solution for every database.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Monitoring and Alerts"],"position":[442,485]},{"id":"Groovy","release":"2022-11-01","title":"Groovy","ring":"hold","quadrant":"languages-and-frameworks","body":"<p>A powerful, optionally typed and dynamic language, with static-typing and static compilation capabilities, for the Java platform aimed at improving developer productivity thanks to a concise, familiar and easy to learn syntax. It integrates smoothly with any Java program, and immediately delivers to your application powerful features, including scripting capabilities, Domain-Specific Language authoring, runtime and compile-time meta-programming and functional programming.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[270,116]},{"id":"Grunt","release":"2022-11-01","title":"Grunt","ring":"hold","quadrant":"tools","body":"<p>A JavaScript task runner, a tool used to automatically perform frequent tasks such as minification, compilation, unit testing, and linting.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[642,580]},{"id":"Gulp","release":"2022-11-01","title":"Gulp","ring":"reduce","quadrant":"tools","body":"<p>A toolkit for automating painful or time-consuming tasks in your javascript development workflow, so you can stop messing around and build something.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[763,467]},{"id":"Hateoas_(Ext_APIS)","release":"2022-11-01","title":"Hateoas (Ext APIS)","ring":"trial","quadrant":"methods-and-patterns","body":"<p>HATEOAS (Hypermedia as the Engine of Application State) is a constraint of the REST application architecture that allows clients to interact with a network application entirely through hypermedia provided dynamically by the server. It enables clients to discover available actions and resources by following links embedded in the responses, thereby promoting a more flexible and decoupled interaction between clients and servers.</p>\\n","featured":true,"flag":"default","tags":["hmpps","API and Integration"],"position":[610,292]},{"id":"IntelliJ","release":"2022-11-01","title":"IntelliJ","ring":"adopt","quadrant":"tools","body":"<p>A cross-platform IDE/source code editor primarily aimed at JVM-based technologies such as Java, Groovy, Kotlin, and Scala but it also supports Java EE and web development. An open-source version is available under the name IntelliJ IDEA Community Edition, and a proprietary version as IntelliJ IDEA Ultimate Edition. IntelliJ IDEA Ultimate Edition can be made to include the feature set of PhpStorm, PyCharm and RubyMine via plugins.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[493,480]},{"id":"Java","release":"2022-11-01","title":"Java","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Java is a high-level, object-oriented programming language designed to be platform-independent through the use of the Java Virtual Machine (JVM). It is widely used for building web applications, mobile apps, and enterprise software due to its simplicity, security features, and robustness. Java follows the &quot;write once, run anywhere&quot; (WORA) principle, allowing code to run on any device that has the JVM installed.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[377,382]},{"id":"Java_-_JPA","release":"2022-11-01","title":"Java Persistence API (JPA)","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Java Persistence API (JPA) is a specification in Java for accessing, managing, and persisting data between Java objects and a relational database. It provides a framework for Object-Relational Mapping (ORM), enabling developers to map Java objects to database tables, simplifying data handling and manipulation in Java applications.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[312,366]},{"id":"Javascript_(JS)","release":"2022-11-01","title":"Javascript (JS)","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>JavaScript is a high-level, dynamic programming language commonly used for creating interactive and dynamic content on websites. It allows developers to implement complex features, such as animations, form validation, and asynchronous communication, enhancing user experience on web pages.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[289,319]},{"id":"JBoss_(WildFly)","release":"2022-11-01","title":"JBoss (WildFly)","ring":"reduce","quadrant":"tools","body":"<p>JBoss WildFly is an open-source Java application server that implements the Java EE (Enterprise Edition) specifications. It provides a runtime environment for developing and deploying enterprise-level applications, offering features like scalability, security, and support for modern Java frameworks and APIs. WildFly is known for its modularity, lightweight footprint, and fast startup times.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Application Servers"],"position":[597,719]},{"id":"Jenkins","release":"2022-11-01","title":"Jenkins","ring":"hold","quadrant":"tools","body":"<p>An open source automation server which enables developers around the world to reliably build, test, and deploy their software.</p>\\n","featured":true,"flag":"default","tags":["hmpps","DevOps & Continuous Integration"],"position":[681,542]},{"id":"Jest_(testing)","release":"2022-11-01","title":"Jest","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Jest is a JavaScript testing framework developed by Facebook, designed to simplify the process of writing unit tests for JavaScript applications. It provides a robust set of features, including a zero-config setup, built-in assertions, test runners, and tools for mocking and spying on functions, making it easy to test both synchronous and asynchronous code.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[268,344]},{"id":"Kanban","release":"2022-11-01","title":"Kanban","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>Kanban is a visual workflow management method that helps teams visualize work, limit work in progress, and optimize efficiency. It uses a board with columns representing different stages of a process, allowing team members to see the status of tasks and manage their workflow effectively.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Development Practices and Methodologies"],"position":[438,302]},{"id":"Keycloak","release":"2022-11-01","title":"Keycloak","ring":"trial","quadrant":"tools","body":"<p>An open source software product to allow single sign-on with Identity Management and Access Management aimed at modern applications and services.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Authentication and Security"],"position":[580,588]},{"id":"Kotlin","release":"2022-11-01","title":"Kotlin","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Kotlin is a statically typed programming language developed by JetBrains, designed to be fully interoperable with Java. It is known for its concise syntax, null safety features, and support for functional programming.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[313,305]},{"id":"Localstack_(Dev)","release":"2022-11-01","title":"Localstack (Dev)","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>AWS LocalStack is an open-source tool that simulates AWS cloud services on a local machine, allowing developers to test and develop cloud applications offline. It provides a local environment for a wide range of AWS services, enabling faster development cycles without incurring costs or requiring internet connectivity.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","DevOps & Continuous Integration","AWS"],"position":[275,424]},{"id":"Make","release":"2022-11-01","title":"Make","ring":"hold","quadrant":"tools","body":"<p>A tool which controls the generation of executables and other non-source files of a program from the program&#39;s source files.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[461,718]},{"id":"Mocha_(testing)","release":"2022-11-01","title":"Mocha","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Mocha is a popular JavaScript test framework that runs on Node.js and in the browser, allowing developers to write and execute asynchronous tests. It provides a flexible structure for organizing tests and supports various assertion libraries, making it easy to create unit and integration tests for JavaScript applications.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[237,355]},{"id":"MoJ__Cloud_Platform","release":"2022-11-01","title":"MoJ Cloud Platform","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>The Ministry of Justice’s Cloud Platform is a modern, cloud-native hosting platform for digital services built within the Ministry of Justice.</p>\\n<p>The Cloud Platform provides a way for teams to:</p>\\n<ul>\\n<li>deploy a service or application into the cloud</li>\\n<li>utilise common tooling, such as monitoring, logging, alerting, and security scanning of container images, without teams needing to configure or manage the infrastructure</li>\\n<li>implement zero downtime deploys, scalability, and high availability of services</li>\\n</ul>\\n<p><a target=\\"_blank\\" rel=\\"noopener noreferrer\\" href=\\"https://https://user-guide.cloud-platform.service.justice.gov.uk/\\">https://user-guide.cloud-platform.service.justice.gov.uk/</a></p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure"],"position":[333,473]},{"id":"MongoDB","release":"2022-11-01","title":"MongoDB","ring":"reduce","quadrant":"platforms-and-operations","body":"<p>MongoDB is a NoSQL database that uses a document-oriented data model to store and manage data in flexible, JSON-like documents. It is designed for scalability and performance, allowing for dynamic schema changes and efficient handling of large volumes of unstructured data.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[177,700]},{"id":"MSK_(Kafka)","release":"2022-11-01","title":"MSK (Kafka)","ring":"trial","quadrant":"platforms-and-operations","body":"<p>MSK Kafka (Amazon Managed Streaming for Apache Kafka) is a fully managed service by Amazon Web Services (AWS) that simplifies the setup, scaling, and management of Apache Kafka, an open-source platform for building real-time streaming data pipelines and applications. MSK enables users to easily stream data between different applications and services, providing a scalable and reliable way to process and analyze large volumes of data in real time.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[152,468]},{"id":"Next.js","release":"2022-11-01","title":"Next.js","ring":"trial","quadrant":"languages-and-frameworks","body":"<p>Next.js is a React framework that enables server-side rendering and static site generation, allowing developers to build fast, optimized web applications with features like automatic code splitting, routing, and API routes. It enhances performance and SEO by rendering pages on the server and supports incremental static regeneration for dynamic content.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[176,345]},{"id":"Node.js","release":"2022-11-01","title":"Node.js","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Node.js is an open-source, cross-platform JavaScript runtime environment that allows developers to execute JavaScript code on the server side. It uses an event-driven, non-blocking I/O model, making it efficient and suitable for building scalable network applications.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[284,362]},{"id":"Nunjucks","release":"2022-11-01","title":"Nunjucks","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Nunjucks is a JavaScript templating engine used for rendering HTML and other text formats. It allows developers to create dynamic web pages by embedding variables, loops, and conditional statements in templates, similar to languages like Django or Jinja2 in Python. Nunjucks is often used in Node.js applications and can be integrated with various web frameworks.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Frontend Tools"],"position":[373,264]},{"id":"Oracle_(all)","release":"2022-11-01","title":"Oracle","ring":"reduce","quadrant":"platforms-and-operations","body":"<p>An Oracle Database is a multi-model database management system produced by Oracle Corporation. It is designed to store and manage large amounts of data, providing features such as SQL support, data integrity, scalability, and security. Oracle Databases are widely used in enterprise environments for transaction processing, data warehousing, and application development.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[114,621]},{"id":"Security_-_OWASP_ZAP","release":"2022-11-01","title":"OWASP ZAP","ring":"trial","quadrant":"tools","body":"<p>An open-source web application security scanner. It is intended to be used by both those new to application security as well as professional penetration testers. It is one of the most active Open Web Application Security Project projects and has been given Flagship status.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Authentication and Security","Testing and Quality Assurance"],"position":[527,619]},{"id":"Pager_Duty","release":"2022-11-01","title":"Pager Duty","ring":"adopt","quadrant":"tools","body":"<p>PagerDuty is a digital operations management platform that helps organizations manage incidents, monitor systems, and improve response times. It provides tools for alerting, escalation, and on-call scheduling, ensuring that the right team members are notified promptly to address critical issues in IT and DevOps environments.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Monitoring and Alerts"],"position":[417,479]},{"id":"Pairing","release":"2022-11-01","title":"Pair programming","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>Pair programming is a software development technique where two programmers work together at one computer. One, known as the &quot;driver,&quot; writes the code while the other, the &quot;observer&quot; or &quot;navigator,&quot; reviews each line of code as it&#39;s written and offers suggestions, leading to improved code quality and collaboration.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Development Practices and Methodologies"],"position":[564,342]},{"id":"PHP","release":"2022-11-01","title":"PHP","ring":"reduce","quadrant":"languages-and-frameworks","body":"<p>A server scripting language, and a powerful tool for making dynamic and interactive Web pages.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[94,191]},{"id":"Pingdom","release":"2022-11-01","title":"Pingdom","ring":"adopt","quadrant":"tools","body":"<p>Pingdom is a website monitoring service that helps users track the uptime, performance, and overall functionality of their websites. It provides real-time alerts and detailed reports, enabling website owners to identify and resolve issues that could affect user experience and site availability.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Monitoring and Alerts"],"position":[550,455]},{"id":"PLSQL","release":"2022-11-01","title":"PLSQL","ring":"reduce","quadrant":"languages-and-frameworks","body":"<p>A combination of SQL along with the procedural features of programming languages. It was developed by Oracle Corporation in the early 90&#39;s to enhance the capabilities of SQL.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[259,53]},{"id":"Postgres_(non_DBaaS)","release":"2022-11-01","title":"Postgres (non DBaaS)","ring":"reduce","quadrant":"platforms-and-operations","body":"<p>PostgreSQL, often referred to as Postgres, is an open-source relational database management system (RDBMS) that uses and extends the SQL language. It is known for its advanced features, such as support for complex queries, transactions, and extensibility, making it suitable for a wide range of applications from small-scale projects to large enterprise systems.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[332,773]},{"id":"Postgres_RDS","release":"2022-11-01","title":"Postgres RDS","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>PostgreSQL RDS (Relational Database Service) is a managed database service provided by Amazon Web Services (AWS) that allows users to set up, operate, and scale PostgreSQL databases in the cloud. It automates tasks such as backups, patching, and scaling, making it easier for developers to manage databases without the need for extensive administrative overhead.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[357,575]},{"id":"Postman","release":"2022-11-01","title":"Postman","ring":"adopt","quadrant":"tools","body":"<p>Postman is a collaboration platform for API development that provides tools for building, testing, and documenting APIs. It allows developers to send requests to APIs, receive responses, and organize tests, making it easier to manage the API lifecycle and streamline the development process.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management","API and Integration"],"position":[419,458]},{"id":"PowerShell","release":"2022-11-01","title":"PowerShell","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>A task-based command-line shell and scripting language built on .NET. PowerShell helps system administrators and power-users rapidly automate tasks that manage operating systems (Linux, macOS, and Windows) and processes.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[256,297]},{"id":"PR_Review","release":"2022-11-01","title":"PR Review","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>A PR review (Pull Request review) is a process in software development where team members evaluate and provide feedback on code changes proposed in a pull request. This review helps ensure code quality, adherence to project standards, and the identification of potential issues before the changes are merged into the main codebase.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Version Control and Code Management"],"position":[491,306]},{"id":"Prettier","release":"2022-11-01","title":"Prettier","ring":"adopt","quadrant":"tools","body":"<p>An opinionated code formatter; Supports many languages; Integrates with most editors.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Frontend Tools"],"position":[517,477]},{"id":"Prometheus_(inc_Alert_Mgr)","release":"2022-11-01","title":"Prometheus (inc Alert Mgr)","ring":"adopt","quadrant":"tools","body":"<p>Prometheus is an open-source monitoring and alerting toolkit widely used for recording real-time metrics and generating alerts. It collects and stores metrics as time-series data, which can be queried and visualized using its query language, PromQL. Prometheus is especially known for its ability to monitor containerized applications and microservices, providing insights into system performance and health.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Monitoring and Alerts"],"position":[431,515]},{"id":"Prototyping_Spikes","release":"2022-11-01","title":"Prototyping Spikes","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>A prototyping spike is a time-boxed research or development activity used in agile software development to explore a specific technical challenge or design concept. It aims to reduce uncertainty by creating a simplified prototype or proof of concept, allowing teams to test assumptions, gather feedback, and make informed decisions before committing to full implementation.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Development Practices and Methodologies"],"position":[438,237]},{"id":"Python","release":"2022-11-01","title":"Python","ring":"reduce","quadrant":"languages-and-frameworks","body":"<p>A programming language that lets you work quickly and integrate systems more effectively.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[233,63]},{"id":"Quay_Docker_Repo","release":"2022-11-01","title":"Quay Docker Repo","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>Quay Docker Repo is a container image repository provided by Quay.io, a service that allows users to store, manage, and share Docker container images. It offers features such as automated builds, vulnerability scanning, and access control, making it easier for developers and organizations to manage their containerized applications securely.</p>\\n","featured":true,"flag":"default","tags":["hmpps","DevOps & Continuous Integration"],"position":[342,417]},{"id":"React_for_static","release":"2022-11-01","title":"React for static","ring":"hold","quadrant":"languages-and-frameworks","body":"<p>A progressive static-site generator for React.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[228,139]},{"id":"React.js","release":"2022-11-01","title":"React.js","ring":"reduce","quadrant":"languages-and-frameworks","body":"<p>A JavaScript library for building user interfaces</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[41,286]},{"id":"REST_API","release":"2022-11-01","title":"REST API","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>A REST API (Representational State Transfer Application Programming Interface) is a set of rules and conventions for building and interacting with web services. It allows different software applications to communicate over the internet using standard HTTP methods (like GET, POST, PUT, DELETE) to perform operations on resources, which are typically represented in formats like JSON or XML. REST APIs are designed to be stateless, meaning each request from a client to the server must contain all the information needed to understand and process that request.</p>\\n","featured":true,"flag":"default","tags":["hmpps","API and Integration"],"position":[528,359]},{"id":"Ruby","release":"2022-11-01","title":"Ruby","ring":"reduce","quadrant":"languages-and-frameworks","body":"<p>A dynamic, open source programming language with a focus on simplicity and productivity. It has an elegant syntax that is natural to read and easy to write.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[187,81]},{"id":"Ruby_Rails","release":"2022-11-01","title":"Ruby Rails","ring":"reduce","quadrant":"languages-and-frameworks","body":"<p>A web-application framework that includes everything needed to create database-backed web applications according to the Model-View-Controller (MVC).</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[285,43]},{"id":"Rust","release":"2022-11-01","title":"Rust","ring":"trial","quadrant":"languages-and-frameworks","body":"<p>A language empowering everyone to build reliable and efficient software.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[330,186]},{"id":"SASS","release":"2022-11-01","title":"SASS","ring":"adopt","quadrant":"tools","body":"<p>CSS with superpowers. Sass (Syntactically Awesome Style Sheets) is a preprocessor scripting language that extends CSS with features like variables, nested rules, mixins, and functions, making it easier to write and maintain stylesheets. It compiles into standard CSS, enhancing the styling capabilities of web projects.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Frontend Tools"],"position":[427,551]},{"id":"SBT_(Scala_build_tool)","release":"2022-11-01","title":"SBT (Scala build tool)","ring":"reduce","quadrant":"tools","body":"<p>An open-source build tool for Scala and Java projects, similar to Java&#39;s Maven and Ant.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[540,755]},{"id":"Scala","release":"2022-11-01","title":"Scala","ring":"reduce","quadrant":"languages-and-frameworks","body":"<p>Scala combines object-oriented and functional programming in one concise, high-level language. Scala&#39;s static types help avoid bugs in complex applications, and its JVM and JavaScript runtimes let you build high-performance systems with easy access to huge ecosystems of libraries.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[95,165]},{"id":"Scrum","release":"2022-11-01","title":"Scrum","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>SCRUM is an agile project management framework used primarily in software development that emphasizes collaboration, iterative progress, and flexibility. It organizes work into small, manageable units called &quot;sprints,&quot; typically lasting two to four weeks, allowing teams to continuously improve and adapt their products based on feedback and changing requirements. Key roles in SCRUM include the Scrum Master, Product Owner, and Development Team, and it incorporates regular ceremonies such as daily stand-ups, sprint planning, and retrospectives to enhance communication and efficiency.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Development Practices and Methodologies"],"position":[511,327]},{"id":"Selenium","release":"2022-11-01","title":"Selenium","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Selenium is an open-source framework used for automating web applications for testing purposes. It allows developers to write tests in various programming languages (such as Java, Python, and C#) to simulate user interactions with web browsers, ensuring that web applications function correctly across different platforms and browsers.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[369,227]},{"id":"Sentry","release":"2022-11-01","title":"Sentry","ring":"adopt","quadrant":"tools","body":"<p>An error monitoring tool that helps software teams discover, triage, and prioritize errors in real-time.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Monitoring and Alerts"],"position":[457,522]},{"id":"Serverless","release":"2022-11-01","title":"Serverless","ring":"trial","quadrant":"platforms-and-operations","body":"<p>AWS Serverless refers to a cloud computing model offered by Amazon Web Services that allows developers to build and run applications without managing server infrastructure. In this model, resources are automatically allocated and scaled based on demand, enabling developers to focus on writing code while AWS handles the underlying server management, provisioning, and scaling. Key services in the AWS Serverless ecosystem include AWS Lambda, Amazon API Gateway, and AWS Step Functions.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[321,633]},{"id":"Sinon_(testing)","release":"2022-11-01","title":"Sinon","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Standalone test spies, stubs and mocks for JavaScript.  Works with any unit testing framework.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[365,328]},{"id":"SNS","release":"2022-11-01","title":"SNS","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>Amazon Simple Notification Service (SNS) is a highly available, durable, secure, fully managed pub/sub messaging service that enables you to decouple microservices, distributed systems, and serverless applications.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[339,528]},{"id":"Security_-_Snyk","release":"2022-11-01","title":"Snyk","ring":"trial","quadrant":"tools","body":"<p>Snyk is a developer security platform that helps organizations find and fix vulnerabilities in their applications, open-source libraries, containers, and infrastructure as code. It integrates into the development workflow to provide real-time feedback and remediation suggestions, promoting secure coding practices.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Authentication and Security"],"position":[534,597]},{"id":"Sonarqube","release":"2022-11-01","title":"Sonarqube","ring":"reduce","quadrant":"tools","body":"<p>An open-source platform developed by SonarSource for continuous inspection of code quality to perform automatic reviews with static analysis of code to detect bugs, code smells, and security vulnerabilities on 20+ programming languages.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[678,641]},{"id":"Spring_Boot","release":"2022-11-01","title":"Spring Boot","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>Spring Boot is an open-source Java-based framework that simplifies the development of stand-alone, production-grade Spring applications. It provides a set of tools and conventions for building microservices and web applications, allowing developers to create and deploy applications quickly with minimal configuration. Spring Boot includes embedded servers, automatic dependency management, and production-ready features, making it easier to develop robust applications.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and Frameworks"],"position":[274,273]},{"id":"SQL_Clone","release":"2022-11-01","title":"SQL Clone","ring":"trial","quadrant":"tools","body":"<p>A database provisioning tool that lets you create full copies of SQL Server databases and backups in seconds</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[630,462]},{"id":"SQL_Server_(non_DBaaS)","release":"2022-11-01","title":"SQL Server (non DBaaS)","ring":"reduce","quadrant":"platforms-and-operations","body":"<p>SQL Server is a relational database management system (RDBMS) developed by Microsoft that uses Structured Query Language (SQL) to manage and manipulate data. It provides a platform for building, deploying, and managing data-driven applications and supports various features like transaction processing, business intelligence, and analytics. Unlike Database as a Service (DBaaS), SQL Server can be installed and managed on local servers or on-premises environments.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Databases and Data Management"],"position":[26,468]},{"id":"SQS","release":"2022-11-01","title":"SQS","ring":"adopt","quadrant":"platforms-and-operations","body":"<p>Amazon Simple Queue Service (SQS) is a fully managed message queuing service that enables you to decouple and scale microservices, distributed systems, and serverless applications.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Cloud and Infrastructure","AWS"],"position":[339,452]},{"id":"Standard_JS","release":"2022-11-01","title":"Standard JS","ring":"adopt","quadrant":"tools","body":"<p>Standard JS (JavaScript Standard Style) is a set of style guidelines and conventions for writing JavaScript code. It promotes consistency and readability in code through rules regarding indentation, naming conventions, spacing, and other formatting aspects. Standard JS emphasizes the use of modern JavaScript features and discourages certain practices to enhance code quality and maintainability.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Frontend Tools"],"position":[414,438]},{"id":"TDD","release":"2022-11-01","title":"TDD","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>Test-Driven Development (TDD) is a software development practice where developers write automated tests for a feature before implementing the actual code. The process typically follows a cycle of writing a failing test, writing the minimum code necessary to pass the test, and then refactoring the code while ensuring all tests still pass. This approach helps ensure code quality, encourages simplicity, and facilitates better design.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Testing and Quality Assurance"],"position":[470,252]},{"id":"Terraform","release":"2022-11-01","title":"Terraform","ring":"adopt","quadrant":"tools","body":"<p>Terraform is an open-source infrastructure as code (IaC) tool that enables users to define, provision, and manage cloud infrastructure using a declarative configuration language. It allows for automated deployment and scaling of resources across various cloud providers, ensuring consistent and reproducible infrastructure management.</p>\\n","featured":true,"flag":"default","tags":["hmpps","DevOps & Continuous Integration"],"position":[546,430]},{"id":"Terragrunt","release":"2022-11-01","title":"Terragrunt","ring":"hold","quadrant":"tools","body":"<p>A thin wrapper for Terraform that provides extra tools for working with multiple Terraform modules. - gruntwork-io/terragrunt.</p>\\n","featured":true,"flag":"default","tags":["hmpps","DevOps & Continuous Integration"],"position":[515,691]},{"id":"Tomcat","release":"2022-11-01","title":"Tomcat","ring":"reduce","quadrant":"tools","body":"<p>Apache Tomcat is an open-source web server and servlet container that runs Java-based web applications. It implements the Java Servlet, JavaServer Pages (JSP), and WebSocket technologies, allowing developers to serve dynamic content and run Java code on a server.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Application Servers"],"position":[676,665]},{"id":"Trunk_based_development","release":"2022-11-01","title":"Trunk based development","ring":"adopt","quadrant":"methods-and-patterns","body":"<p>Trunk-Based Development is a software development practice where all developers work on a single branch (the &quot;trunk&quot;) of the version control system, integrating their changes frequently, often multiple times a day. This approach minimizes long-lived branches, encourages continuous integration, and helps maintain a stable codebase, reducing the complexity of merging and conflict resolution.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Version Control and Code Management","Development Practices and Methodologies"],"position":[511,299]},{"id":"Typescript","release":"2022-11-01","title":"Typescript","ring":"adopt","quadrant":"languages-and-frameworks","body":"<p>TypeScript is a superset of JavaScript that adds static typing to the language. It enables developers to catch errors at compile time rather than runtime, improving code quality and maintainability. TypeScript compiles to plain JavaScript, making it compatible with existing JavaScript code and frameworks.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Languages and frameworks"],"position":[316,335]},{"id":"VSCode","release":"2022-11-01","title":"VSCode","ring":"adopt","quadrant":"tools","body":"<p>A source-code editor developed by Microsoft for Windows, Linux and macOS. It includes support for debugging, embedded Git control and GitHub, syntax highlighting, intelligent code completion, snippets, and code refactoring.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[508,441]},{"id":"Waterfall","release":"2022-11-01","title":"Waterfall","ring":"reduce","quadrant":"methods-and-patterns","body":"<p>Waterfall development is a linear and sequential software development methodology where each phase (requirements, design, implementation, verification, and maintenance) must be completed before moving on to the next. It emphasizes a structured approach, with defined stages and milestones, making it easy to manage but less flexible in accommodating changes once a phase is completed.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Development Practices and Methodologies"],"position":[621,95]},{"id":"Weblogic","release":"2022-11-01","title":"Weblogic","ring":"reduce","quadrant":"tools","body":"<p>Oracle WebLogic Server is a Java EE application server currently developed by Oracle Corporation.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Application Servers"],"position":[733,584]},{"id":"Webpack","release":"2022-11-01","title":"Webpack","ring":"adopt","quadrant":"tools","body":"<p>A module bundler. Its main purpose is to bundle JavaScript files for usage in a browser, yet it is also capable of transforming, bundling, or packaging.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Frontend Tools"],"position":[458,570]},{"id":"Yarn","release":"2022-11-01","title":"Yarn","ring":"reduce","quadrant":"tools","body":"<p>Yarn is a package manager for JavaScript that allows developers to manage project dependencies efficiently. It provides a fast, reliable, and secure way to install, update, and configure packages in JavaScript projects, using a lockfile to ensure consistent installations across different environments. Yarn was developed by Facebook to address issues with the npm package manager, such as performance and security.</p>\\n","featured":true,"flag":"default","tags":["hmpps","Build Tools and Package Management"],"position":[733,554]}]}');

